INSERT INTO `objects` (`id`, `title`, `description`, `user_id`, `creation_time`, `edit_time`, `type_id`) VALUES
	(1, 'Все', '[lang=ru]Общая группа для зарегистрированных пользователей и гостей.[/lang][lang=en]Shared group for registered users and guests.[/lang]', NULL, '2022-03-04 21:03:14', '2024-10-01 14:03:13', 1),
	(2, 'Система', '', NULL, '2022-03-04 21:03:14', '2024-03-28 14:06:29', 2),
	(3, 'Group_system', NULL, 2, '2023-11-21 18:42:34', '2024-03-21 00:42:11', 1),
	(4, 'Общие разделы', NULL, 2, '2023-11-09 17:05:37', '2023-11-21 19:55:54', 3),
	(5, '<div></div>', 'Идейные соображения высшего порядка, а также постоянное информационно-пропагандистское обеспечение нашей деятельности способствует подготовки и реализации дальнейших направлений развития. Идейные соображения высшего порядка, а также начало повседневной работы по формированию позиции представляет собой интересный эксперимент проверки систем массового участия. Равным образом дальнейшее развитие различных форм деятельности влечет за собой процесс внедрения и модернизации дальнейших направлений развития. Равным образом дальнейшее развитие различных форм деятельности обеспечивает широкому кругу (специалистов) участие в формировании направлений прогрессивного развития. С другой стороны дальнейшее развитие различных форм деятельности влечет за собой процесс внедрения и модернизации соответствующий условий активизации. Равным образом сложившаяся структура организации влечет за собой процесс внедрения и модернизации направлений прогрессивного развития.\r\n\r\nТоварищи! реализация намеченных плановых заданий представляет собой интересный эксперимент проверки модели развития. Повседневная практика показывает, что начало повседневной работы по формированию позиции требуют от нас анализа направлений прогрессивного развития. Не следует, однако забывать, что постоянный количественный рост и сфера нашей активности представляет собой интересный эксперимент проверки форм развития.', 2, '2022-03-04 21:05:32', '2024-10-06 11:07:40', 3),
